(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["chunk-2d0c7941"],{"50e5":function(n,t){n.exports='# Result 处理结果\n\n结果页用于对用户进行的一系列任务处理结果进行反馈。\n（已废弃，antd vue 1.5.0 起内置支持该组件）\n\n引用方式：\n```vue\nimport { Result } from \'@/components\'\n\nexport default {\n    components: {\n        Result\n    }\n}\n```\n\n使用方式：\n```vue\n<template>\n    <result type="success" title="标题" description="结果描述">\n        <template slot="action">\n            <p>操作建议，一般放置按钮组</p>\n            <a-button>修改</a-button>\n        </template>\n        <div>\n            其他补充信息，自带灰底效果\n        </div>\n    </result>\n</template>\n```\n\n## API\n\n| 参数      | 说明                                      | 类型         | 默认值 |\n|----------|------------------------------------------|-------------|-------|\n| type | 类型，不同类型自带对应的图标 | Enum {\'success\', \'error\'} | - |\n| title       | 标题     | String 或 slot  | -    |\n| description | 结果描述    | String 或 slot  | -    |\n| extra       | 补充信息，有默认的灰色背景     | slot  | -    |\n| actions     | 操作建议，推荐放置跳转链接，按钮组等    | slot  | -    |\n'}}]);